import React from 'react'
import { Link } from 'react-router-dom'

const CabinetPopUp = () => {
  return (
    <div>
      <Link to='/cabinet'>Login</Link>
      <Link to='/registration'>Create accoutn</Link>
    </div>
    
  )
}

export default CabinetPopUp
